import React from "react";

const About = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "Right",
        alignItems: "Right",
        height: "100vh",
      }}
    >
      <h1>Platvoet Development in the Netherlands</h1>
      <br />
      email:
      <img
        src="../assets/platvoetdevelopment.png"
        alt="email"
        width="500"
        height="100"
      ></img>
    </div>
  );
};

export default About;
